script: |
  super -f text -I q185.spq | sort > q185.out

inputs:
  - name: q185.spq
    data: |
      SELECT - - ( col0 ) AS col2 FROM tab2 (FORMAT parquet) WHERE NULL = + - ( col0 ) * + 34 * + col1 + - + CAST ( NULL AS INTEGER ) - - + col2 - + CAST ( NULL AS REAL ) * 8;
  - name: tab2

outputs:
  - name: q185.out
    data: |
